import Expenseitem from "../Expenses/Expenseitem";
import ExpenseFilter from "../ExpenseFilter/ExpenseFilter";
import { useState } from "react";


const ExpenseTask = (props) => {

 const [FilteredYear, setFilteredYear] = useState('2020');

 const filterCall = (selectedYear) => {
  setFilteredYear(selectedYear);
};
const Filtered = props.Expdetails.filter(each=>{
  return each.thatDay.getFullYear().toString() === FilteredYear;
  });

 return (
   <div>
            <div className='expenses'>
            <ExpenseFilter selected={FilteredYear} filterMethod={filterCall}/>
              {
                Filtered.map(exp=> <Expenseitem
                  title={exp.title}
                  rate={exp.rate}
                  thatDay={exp.thatDay}
                  />)
                }
                
            </div>
          </div>
        );
      }
    
      export default ExpenseTask;
